import React, { Component } from "react";

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      status: true,
    };
    this.sair = this.sair.bind(this);
  }

  sair() {
    this.state;
  }

  sair;

  render() {
    return (
      <div>
        {this.state.status ? (
          <div>
            <h2>Bem vindo ao sistema</h2>
            <button onClick={this.sair}>Sair no sistema</button>
          </div>
        ) : (
          <div>
            <h2>Olá visitante, faça login</h2>
          </div>
        )}
      </div>
    );
  }
}

export default App;
